import React from 'react';
import LostPetCard from '../components/LostPetCard';

const dummyLost = [
  { id:1, name:'Oreo', desc:'Negro y blanco, visto por última vez en calle A', photo:'https://via.placeholder.com/150' },
];

export default function LostPets() {
  return (
    <div>
      <h2 className="mb-4">Mascotas Perdidas</h2>
      <div className="row mb-4">
        {/* Aquí podrías meter un formulario de reporte */}
      </div>
      <div className="row">
        {dummyLost.map(lp => (
          <div className="col-md-4 mb-3" key={lp.id}>
            <LostPetCard pet={lp} />
          </div>
        ))}
      </div>
    </div>
  );
}
